import React from "react";

function Toggle() {
  return (
    <div>
      <div class="btn-group" role="group" aria-label="Basic example">
        <button type="button" class="btn btn-primary">
          Latest
        </button>

        <button type="button" class="btn btn-primary">
          Trending
        </button>
      </div>
    </div>
  );
}

export default Toggle;
